import Header from "../components/Header.js";
export default function Solutions() {
  return (
    <div>
      <Header/>
      <div className="container-fluid black">
        <div className="container">
          <h1 className="subTitle whiteTxt">The Goal</h1>
        </div>
      </div>
    </div>
  );
}
